import React from "react";
import classes from "./item.module.css";

const Item = (props) => {
  return (
    <NavLink className={classes.item}>
      <h5>{props.obj.name}</h5>
      <p>{props.obj.date}</p>
    </NavLink>
  );
};

export default Item;
